import { render } from '@testing-library/react';
import React, {Component} from 'react';
import ReactDOM from 'react-dom';

export default class App extends Component{
  render(){
    return(
      <div>
        <NewPaymentButton />
        <NewTaskButton />
      </div>
    );
  }
}
function NewTaskButton(){
  return(
  <button>
    Ingresar Tarea
  </button>
  );
}
function NewPaymentButton(){
  return(
  <button>
    Ingresar Pago
  </button>
  );
}
